import React from 'react';
import './nav.css';

function Nav(props) {
  const linkTitle = props.titles;
  const linkTitles = linkTitle.map((link) =>
    <li className='nav-link' key={link}>
        {link}
        {console.log(link)}
    </li>
  );

    const numbers = props.numbers;
    const listItems = numbers.map((number) =>
      <li key={number.toString()}>
        {number}
      </li>
    );
    return (
      <ul>{listItems}</ul>
    );


  return (
    <div className="navbar">
        <ul className="nav">
          {linkTitles}
        </ul>
      </div>
  );
}

export default Nav;
